import React from 'react';

function Card(props){
return(

      <div className="card">
        <div className="top">
          <h2>{props.name}</h2>
          <img classname = "circle-img"
            src={props.imgURL}
          />
        </div>
        <div className="bottom">
          <p> {props.phone} </p>
          <p> {props.email} </p>
        </div>
      </div>
)
}



export default Card;
